import React from 'react';
import { useNavigate } from 'react-router-dom';
import headbg from './Images/header_bg.jpg'; 
import wesafelogo from './Images/wesafe_Logo.png';
import userprofile from './Images/avatar.png';
import toggle from './Images/toggle_menu.png';

const Dashboard = ({ userProfile, onToggleSidebar }) => {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Logout logic here
    navigate('/');
  };

  return (
    <div className="bg-cover bg-center h-24 flex items-center justify-between px-4" 
         style={{ backgroundImage: `url(${headbg})`, backgroundRepeat: 'no-repeat' }}>
      <button onClick={onToggleSidebar} className="focus:outline-none">
        <img src={toggle} alt="Toggle Menu" className="h-8 w-8" />
      </button>
      
      <div className="flex justify-center flex-grow">
        <img src={wesafelogo} alt="Company Logo" className="h-16" />
      </div>

      <div className="flex items-center">
        <img src={userprofile} alt="User Profile" className="h-12 w-12 rounded-full mr-4" />
        <button onClick={handleLogout} className="bg-white text-green-600 font-semibold py-2 px-4 rounded-full shadow focus:outline-none">
          Logout
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
